import React, { Component } from 'react'
import './index.css'

export default class List extends Component {
    render() {
        return (
           <div>
            <select name="sum" id="2">
            <option value="1">1</option>
            <option value="2">2</option>
            <option value="3">3</option>

           </select>
           <button> + </button>
           <button> - </button>
           <button>奇数加</button>
           <button>异步加</button>
            </div>
        )
    }
}
